    OUT p_Message VARCHAR(255)
)
BEGIN
	DECLARE lastEntityId INT DEFAULT 1;
    DECLARE lastassignmentId INT DEFAULT 1;
    DECLARE EXIT HANDLER FOR SQLEXCEPTION,SQLWARNING
    BEGIN
        GET DIAGNOSTICS CONDITION 1
        @p1= MESSAGE_TEXT;
        SET p_Message = @p1;
        ROLLBACK;
    END;
    #if any row in the table then search for existing record
    SELECT COUNT(1) INTO @entityRowCount FROM entity;
		IF @entityRowCount IS NOT NULL AND @entityRowCount != 0
		THEN
			#select last row id from person table
			SELECT e.entityId INTO lastEntityId FROM entity as e
			ORDER BY e.entityId DESC
			LIMIT 1;
		
			SET lastEntityId = lastEntityId + 1;		
		END IF;
    
     START TRANSACTION;
			INSERT INTO entity(entityId, categoryId, entityName, isDeleted, createDt, lastUpdateDt)
			VALUES(lastEntityId, p_catId, p_entityName, 0, NOW(), NOW());
            
            #INSERT INTO assignment(assignmentId, personId, entityId, startDate, endDate,isCollab, isDeleted, createDt, updateDt,Role,Title)
			#VALUES(lastassignmentId, p_personId, lastEntityId,start_date,end_date,isCollab,0,NOW(), NOW(),p_role,p_title);
			
			INSERT INTO assignment(assignmentId, personId, entityId, startDate, endDate,isDeleted, createDt, updateDt,Role,Title)
			VALUES(lastassignmentId, p_personId, lastEntityId,start_date,end_date,0,NOW(), NOW(),p_role,p_title);
