CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_AddUpdateAddress`(
	IN p_addressId INT(11),
    IN p_addressTypeId INT(11),
    IN p_addressLine1 VARCHAR(255),
	IN p_addressLine2 VARCHAR(255),
	IN p_cityID INT(11),
    IN p_stateID INT(11),
    IN p_countryId INT(11),
    IN p_Zip INT(11),
    IN p_startDate DATETIME,
    IN p_endDate DATETIME,
    IN p_personId INT(11),
    OUT p_Message VARCHAR(255)
)
BEGIN
	
    DECLARE lastAddressId INT DEFAULT 1; #variable to get last row id from address table 
    DECLARE bToupdate BOOLEAN DEFAULT FALSE; #variable to indicate if the address should be added or updated
    
	#declare cursor for error handling
    DECLARE EXIT HANDLER FOR SQLEXCEPTION,SQLWARNING
    BEGIN
		# return error message if any error in transaction
        GET DIAGNOSTICS CONDITION 1
        @p1= MESSAGE_TEXT;
        SET p_Message = @p1;
        ROLLBACK;
    END;
    
    IF p_addressId = 0 #since the input address id is 0, the operation is insert
    THEN
		#get the last row id from the address table
		SELECT COUNT(1) INTO @rowCount FROM address;
        #in case rows are present, increament by 1
		IF @rowCount IS NOT NULL AND @rowCount != 0
		THEN
			
			SELECT COUNT(1) INTO lastAddressId 
			FROM address
			ORDER BY addressId DESC
            LIMIT 1;
            
            SET lastAddressId = lastAddressId + 1;
		END IF;
    ELSE #since input address id is present, the operation must be update
		SET bToupdate = TRUE;
	END IF;
    
    START TRANSACTION;
		IF bToupdate = TRUE #if opeartion is update
        THEN			
			UPDATE address
            SET
				addressLine1 = p_addressLine1,
                addressLine2 = p_addressLine2,
                cityId = p_cityID,
                stateId = p_stateID,
                countryId = p_countryId,
                zip = p_Zip,
                startDate = p_startDate,
                endDate = p_endDate,
                addressTypeId = p_addressTypeId,
                updatedDt = NOW()
			WHERE
				addressId = p_addressId
                AND personId = p_personId
                AND !isDeleted;
            
		ELSE
			#operation is insert
			INSERT INTO address(addressId, addressLine1, addressLine2, cityId, stateId, countryId, zip, startDate, endDate, addressTypeId, isDeleted, createdDt, updatedDt, personId)
			VALUES(lastAddressId, p_addressLine1, p_addressLine2, p_cityID, p_stateID, p_countryId, p_Zip, p_startDate, p_endDate, p_addressTypeId, 0, NOW(), NOW(), p_personId);
        END IF;
		
        #update the person to set profile approved to false
		UPDATE person
		SET 
			isProfileApproved = 0, #set profile approved to false
            profileProcessDt = NULL,
			updateDt = NOW()
		WHERE 
			personId= p_personId;

	COMMIT;
    
    SET p_Message = 'S0000';
    
END ;;
DELIMITER ;
