CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_AuthenticateUsers`(
#This procedure accepts username as email since its unique per user per role and returns Users Id and Role(e.g. Admin or regular)
IN p_username VARCHAR(255),
IN p_password VARCHAR(255),
OUT p_message VARCHAR(255)
)
BEGIN

	SELECT u.userId INTO @personId FROM user_credential AS u, person AS p
    WHERE !u.isDeleted
    && !u.isNewUser
    && u.userId = p.personId

    && trim(u.email) = trim(p_username)
    && trim(u.password) = trim(p_password);

	IF @personId IS NOT NULL OR @personId != 1
    THEN
    
		SET p_message = 'AUTHENTICATED';
        
		SELECT 
			sr.sercRolecName AS SercRole, 
            p.firstName AS 'FirstName', 
            p.lastName AS 'LastName', 
            p.Salutation AS 'Salutation', 
            p.personId AS 'PersonId',
            p.isProfileComplete ProfileComplete
		FROM 
			user_credential AS u, 
            person AS p, 
            serc_role AS sr
		WHERE u.userId = @personId
		&& !sr.isDeleted
        && sr.sercroleId = u.sercRoleId
        && u.userId = p.personId;
	ELSE
		SET p_message = 'FAILURE';
	END IF;

END ;;
DELIMITER ;
