CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_GetAddressByPersonId`(
	IN p_personId INT
)
BEGIN

	SELECT 
		a.addressId AS AddressId, 
        a.addressLine1 AS AddressLine1, 
        a.addressLine2 AS AddressLine2, 
        a.cityId AS CityId, 
        a.stateId AS StateId, 
        a.countryId AS CountryId,
        a.zip AS Zip,
        DATE_FORMAT(a.startDate, '%m/%d/%y') AS StartDate, 
        DATE_FORMAT(a.endDate, '%m/%d/%y') AS EndDate,
		a.addressTypeId AS AddressTypeId,
        IF (p.preferredmailingAddress = a.addressId, 1, 0) AS PreferredMailing,
        c.CityName AS CityName, 
        s.stateName AS StateName, 
        co.countryName AS CountryName,
        t.name AS AddressTypeName
    FROM 
		address AS a, 
        cities AS c, 
        countries AS co, 
        states AS S,
		address_type AS t,
        person AS p
    WHERE !a.isDeleted
    && !c.isDeleted
    && !s.isDeleted
    && !co.isDeleted
    && !t.isDeleted
    && c.cityId = a.cityId
    && s.stateId = a.stateId
    && co.countryId = a.countryId
    && t.addressTypeId = a. addressTypeId
    && a.personId = p_personId
    && p.personId = p_personId
    && (t.name != 'Birth Address' AND t.name != 'Occupation Address');

END ;;
