CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_GetPersonalProfile`(
	IN p_personId INT
)
BEGIN

	SELECT
		p.salutation AS Saluation,
		p.firstName AS FirstName,
        p.middleName AS MiddleName,
        p.lastName AS LastName,
        DATE_FORMAT(p.dateOfBirth,'%m/%d/%Y') AS DOB,
        p.isProfileApproved AS ProfileApproved
	FROM
		person AS p
	WHERE
		p.personId = p_personId
        AND !p.isDeleted;

	SELECT
		a.addressId AS AddressId,
        a.CityId AS CityId,
        a.StateId AS StateId,
        a.CountryId AS CountryId,
        c.CityName AS CityName, 
        s.stateName AS StateName, 
        co.countryName AS CountryName
	FROM
		person AS p,
        address AS a,
        cities AS c, 
        countries AS co, 
        states AS S
	WHERE
		p.personId = p_personId
        AND a.personId = p_personId
        AND a.addressTypeId = 2
        AND !a.isDeleted
        AND !p.isDeleted
		AND c.cityId = a.cityId
        AND s.stateId = a.stateId
        AND co.countryId = a.countryId; #Birthaddress type

END ;;
