CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_GetRegisteredUserDetails`(
IN p_personId INT
)
BEGIN

	#stored procedure to get the individual users detail for admin panel
    SELECT 
		p.personId AS PersonId, 
        p.firstName AS FirstName, 
        p.lastName AS LastName,
        u.Email AS Email,
        IF (sr.sercRolecName = 'TrustedUser', 'Trusted User', 'Admin User') AS SercRoleName,
        b.categoryName AS CategoryName,
        b.businessCategoryId AS CategoryId,
        e.entityName AS EntityName,
        DATE_FORMAT(u.createDt,'%m/%d/%y') AS RequestedDate, 
        DATE_FORMAT(u.processDt,'%m/%d/%y') AS ProcessedDate, 
        u.comments AS Comments
    FROM person AS p, user_credential AS u, entity as e, assignment as a, business_category as b, serc_role as sr
    WHERE !p.isDeleted
    && !u.isDeleted
    && !e.isDeleted
    && !a.isDeleted
    && !b.isDeleted
    && !sr.isDeleted
	&& p.personId = p_personId
    && u.userId = p.personId
    && a.personId = p.personId
    && e.entityId = a.entityId
    && sr.sercRoleId  = u.sercRoleId
    && e.categoryId = b.businessCategoryId;
    
END ;;
