CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_ProcessNewRegisteredUser`(
	IN p_personId INT,
    IN p_action VARCHAR(10),
    IN p_comments VARCHAR(500),
    IN p_industry_name VARCHAR(255),
    IN p_category_id INT,
	OUT p_message VARCHAR(255)
)
BEGIN
	 #declare cursor for error handling
    DECLARE EXIT HANDLER FOR SQLEXCEPTION,SQLWARNING
    BEGIN
		# return error message if any error in transaction
        
        GET DIAGNOSTICS CONDITION 1
        @p1= MESSAGE_TEXT;
        SET p_Message = @p1;
        ROLLBACK;
    END;
    
    #check if the user is already approved, if not the process else return error message    
    SELECT COUNT(1) INTO @COUNT FROM user_credential
    where userId = p_personId
    && isNewUser
    && !isDeleted;
    
    IF @COUNT IS NULL OR @COUNT > 0
    THEN
		IF p_action = 'approve'
        THEN
			START TRANSACTION;
			UPDATE user_credential
			SET isNewUser = 0,
			processDt = NOW(),
            updateDt = NOW(),
			comments = p_comments
			WHERE userId = p_personId
			&& !isDeleted;
            
            UPDATE person
            SET isAdminApproved = 1,
            updateDt = NOW()
            WHERE personId = p_personId
            && !isDeleted;

			UPDATE entity
            SET entityName = p_industry_name,
				categoryId = p_category_id
            WHERE 
				entity.entityId = (SELECT 
										sercdb.assignment.entityId 
									FROM 
										sercdb.assignment 
									WHERE 
                                    sercdb.assignment.personId = p_personId);
       
            
            COMMIT;
            
            SELECT 
				u.email AS Email, 
                p.firstName AS FirstName, 
                p.lastName AS LastName 
			FROM 
				user_credential AS u, person AS p
            WHERE !p.isDeleted
			&& !u.isDeleted
			&& u.userId = p_personId
            && p.personId = p_personId;
            
            SET p_Message = 'SUCCESS';
            
		ELSEIF p_action = 'reject'
		THEN
			START TRANSACTION;
            
				UPDATE user_credential
				SET isNewUser = 0,
                processDt = NOW(),
				comments = p_comments,
                updateDt = NOW()
				WHERE userId = p_personId
				&& !isDeleted;
                
                UPDATE entity
				SET entityName = p_industry_name,
					categoryId = p_category_id
				WHERE 
					entity.entityId = (SELECT 
											sercdb.assignment.entityId 
										FROM 
											sercdb.assignment 
										WHERE 
											sercdb.assignment.personId = p_personId);
			
            COMMIT;
			SET p_Message = 'SUCCESS';
		ELSE
			SET p_Message = 'ERROR';
		END IF;
	ELSE # Control should never reach this point when called from UI.
		SET p_Message = 'ALREADYPROCESSED';
	END IF;
END ;;
DELIMITER ;
