CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_ProcessProfileRequest`(
	IN p_personId INT,
    IN p_action VARCHAR(10),
    IN p_comments VARCHAR(500),
	OUT p_message VARCHAR(255)
)
BEGIN
	 #declare cursor for error handling
    DECLARE EXIT HANDLER FOR SQLEXCEPTION,SQLWARNING
    BEGIN
		# return error message if any error in transaction
        
        GET DIAGNOSTICS CONDITION 1
        @p1= MESSAGE_TEXT;
        SET p_Message = @p1;
        ROLLBACK;
    END;
    
	IF LOWER(p_action) = 'approve'
	THEN
		START TRANSACTION;
		
			UPDATE person
			SET isProfileApproved = 1,
			updateDt = NOW(),
            profileProcessDt = NOW()
			WHERE personId = p_personId
			&& !isDeleted;

		COMMIT;
		
		SELECT 
			u.email AS Email, 
			p.firstName AS FirstName, 
			p.lastName AS LastName 
		FROM 
			user_credential AS u, person AS p
		WHERE !p.isDeleted
		&& !u.isDeleted
		&& u.userId = p_personId
		&& p.personId = p_personId;
		
		SET p_Message = 'SUCCESS';
		
	ELSEIF LOWER(p_action) = 'reject'
	THEN
		START TRANSACTION;
		
			UPDATE person
			SET isProfileApproved = 0,
			updateDt = NOW(),
            profileProcessDt = NOW()
			WHERE personId = p_personId
			&& !isDeleted;
		
		COMMIT;
		SET p_Message = 'SUCCESS';
	ELSE
		SET p_Message = 'ERROR';
	END IF;
END ;;
