CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_RegisterNewPerson`(
	IN p_salutation VARCHAR(5),
	IN p_firstName VARCHAR(50),
	IN p_lastName VARCHAR(50),
	IN p_emailId VARCHAR(255),
    In p_sercRoleId Int(1),
	IN p_password VARCHAR(255),
    IN p_username VARCHAR(255),
    IN p_entityName VARCHAR(255),
    IN p_CategoryId Int(1),
	OUT p_Message varchar(10000)
)
BEGIN

	DECLARE lastPersonId INT DEFAULT 1; #variable to get last row id from person table 
    DECLARE lastEntityId INT DEFAULT 1; #variable to get last row id from entity table
    DECLARE insertUser BOOLEAN DEFAULT FALSE; #variable to indicate if insertion has to be done
    
    #declare cursor for error handling
    DECLARE EXIT HANDLER FOR SQLEXCEPTION,SQLWARNING
    BEGIN
		# return error message if any error in transaction
        
        GET DIAGNOSTICS CONDITION 1
        @p1= MESSAGE_TEXT;
        SET p_Message = @p1;
        ROLLBACK;
    END;
    
    SELECT COUNT(1) INTO @userNameCount FROM user_credential
    WHERE trim(username) = trim(p_username);
    
    SELECT COUNT(1) INTO @emailCount FROM user_credential
    WHERE trim(email) = trim(p_emailId);
    
    IF @userNameCount > 0
    THEN
		SET p_Message = 'EREG0001';
	ELSEIF @emailCount > 0
    THEN
		SET p_Message = 'EREG0002';
	ELSE
		SET insertUser = TRUE;
	END IF;
    
    
    IF insertUser = TRUE
    THEN
    
		SELECT COUNT(1) INTO @rowCount FROM person;

		#if there is last person then add 1 to it else continue with 1
		IF @rowCount IS NOT NULL AND @rowCount != 0
		THEN
			#select last row id from person table
			SELECT p.personId INTO lastPersonId FROM person as p
			ORDER BY p.personId DESC
			LIMIT 1;
		
			SET lastPersonId = lastPersonId + 1;		
		END IF;
		
		SELECT COUNT(1) INTO @entityRowCount FROM entity;
		IF @entityRowCount IS NOT NULL AND @entityRowCount != 0
		THEN
			#select last row id from person table
			SELECT e.entityId INTO lastEntityId FROM entity as e
			ORDER BY e.entityId DESC
			LIMIT 1;
		
			SET lastEntityId = lastEntityId + 1;		
		END IF;
		
		START TRANSACTION;
		
			INSERT INTO PERSON(personId, salutation, firstName, lastName, isAdminApproved, isDeleted, createDt, updateDt)
			VALUES(lastPersonId,p_salutation, p_firstName,p_lastName, 0, 0, NOW(), NOW());
			
			INSERT INTO user_credential(userId, email, sercRoleId, username, password, isNewUser,isDeleted,createDt,updateDt)
			VALUE(lastPersonId, p_emailId, p_sercRoleId, p_username, p_password, 1, 0, NOW(), NOW());
			
			INSERT INTO entity (entityId, entityName, CategoryId)
			VALUE(lastEntityId,p_entityName, p_CategoryId);
			
			INSERT INTO assignment (entityId, personId,isCollab)
			VALUE(lastEntityId,lastPersonId,1);
			
		COMMIT;
    
		SELECT 
			email AS AdminEmail
		FROM
			user_credential
		WHERE
			! isDeleted && sercRoleId = 2;
			
		SET p_Message = 'SUCCESS';
        
	END IF;
END ;;
DELIMITER ;
