CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_UpdatePersonalProfile`(
	IN p_person_id INT, 
	IN p_fname varchar(255),
	IN p_lname varchar(255), 
	IN p_sal varchar(45),
	IN p_mname varchar(255),
	IN p_dob datetime,                    
	OUT p_Message VARCHAR(255)
)
BEGIN
	
    #declare cursor for error handling
    DECLARE EXIT HANDLER FOR SQLEXCEPTION,SQLWARNING
    BEGIN
		# return error message if any error in transaction
        
        GET DIAGNOSTICS CONDITION 1
        @p1= MESSAGE_TEXT;
        SET p_Message = @p1;
        ROLLBACK;
    END;
    
    START TRANSACTION;

		UPDATE person
		SET firstName = p_fname, 
			lastName = p_lname, 
            salutation= p_sal, 
            middleName=p_mname, 
            dateOfBirth = p_dob,
            isProfileApproved = 0, #set profile approved to false
            profileProcessDt = NULL,
            updateDt = NOW()
		WHERE 
			personId= p_person_id
        AND !isDeleted;

	COMMIT;
    
    SET p_Message = 'S0000';
    
END ;;
